			< div className="topbar" >
				{this.rendergrid_1()}
				{this.rendergrid_2()}
				{this.rendergrid_3()}
			</div>
		)
	}


	rendergrid_c1()
	{
		return(
			<div className="gridc1">
			Grid1
			</div>
		);
	}

	rendergrid_c2()
	{
		return(
			<div className="gridc2">
			Grid2
			</div>
		);
	}

	render_center_right()
	{
		return(
			<div className="centerright">
				center right
			</div>

		);

	}


	renderCenterArea()
	{
		return(
			<div className="centerarea">
				{this.rendergrid_c1()}
				{this.rendergrid_c2()}
			</div>
		);
	}

	render()
	{
		return(
			<div>
				{this.renderTopBar()}
				{this.renderCenterArea()}
			</div>
		);
	}
}

export default GridLayout;
